import styled from 'styled-components';
import { Doughnut } from 'react-chartjs-2';

const SectionWrapper = styled.div`
  border-bottom: 1px solid grey;
  display: flex;
  flex-direction: row;
  padding: 48px 0;
`;

const GroupWrapper = styled.div`
  width: 50%;
`;

const CategoryTitle = styled.p`
  font-size: 24px;
  font-weight: 700;
`;

const ChartWrapper = styled.div`
  display: flex;
  flex-direction: row;
`;

const VisualWrapper = styled.div`
  display: flex;
  flex-direction: column;
  margin-left: 64px;
`;

const SelectedData = styled.p`
  text-align: center;
`;

const LedgendWrapper = styled.div`
  width: 30%;
`;

const LegendColorTextWrapper = styled.div`
  align-items: center;
  cursor: pointer;
  display: flex;
  flex-direction: row;
  margin: 12px 0;
`;

const LedgendItem = styled.p`
  margin: 0;
`;

const LegendColor = styled.p`
  background-color: ${props => props.color};
  border-radius: 50%;
  height: 10px;
  margin: 0 24px 0 0;
  width: 10px;
`;

const StyledDoughnut = styled(Doughnut)`
  margin-top: -48px;
`;

export{
  SectionWrapper,
  GroupWrapper,
  CategoryTitle,
  ChartWrapper,
  VisualWrapper,
  SelectedData,
  LedgendWrapper,
  LegendColorTextWrapper,
  LedgendItem,
  LegendColor,
  StyledDoughnut
};
